import React, { Component } from 'react';
import Logo from '../logo.png';
import '../css/layout.css'
class Header extends Component {
    render() {

        if(this.props.data){
            var name = this.props.data.name;
            var description= this.props.data.description;
            var description2= this.props.data.description2;
          }
      
        return(
            <header id="home">
            <a href="/"><img className="logo" src={Logo} alt="Logo" /></a>
            <div className="row banner">
               <div className="banner-text">
                  <h2 className="responsive-headline">Hello! I'm {name}.</h2>
                  <h3 className="responsive-headline">Consult, Design, and Develop Websites</h3>
                  <h4>{description}<br/>{description2}<br/></h4>
                  <hr />
                  <div >
                  <div className="hero__btn">
                  <button className="btn">Let's Make Contact</button>
                </div>
                </div>
               </div>
            </div>
         </header>
          );
        }
      }
      
      export default Hero;
